    "Advanced": "\u023ad\u028c\u0250n\u0254\u01ddd", 
    "After the subsection\\'s due date has passed, learners can no longer access its content. The subsection remains included in grade calculations.": "\u023a\u025f\u0287\u01dd\u0279 \u0287\u0265\u01dd snbs\u01dd\u0254\u0287\u1d09\u00f8n\\'s dn\u01dd d\u0250\u0287\u01dd \u0265\u0250s d\u0250ss\u01ddd, l\u01dd\u0250\u0279n\u01dd\u0279s \u0254\u0250n n\u00f8 l\u00f8n\u0183\u01dd\u0279 \u0250\u0254\u0254\u01ddss \u1d09\u0287s \u0254\u00f8n\u0287\u01ddn\u0287. \u0166\u0265\u01dd snbs\u01dd\u0254\u0287\u1d09\u00f8n \u0279\u01dd\u026f\u0250\u1d09ns \u1d09n\u0254lnd\u01ddd \u1d09n \u0183\u0279\u0250d\u01dd \u0254\u0250l\u0254nl\u0250\u0287\u1d09\u00f8ns.", 
