    "All accounts were created successfully.": "\u023all \u0250\u0254\u0254\u00f8nn\u0287s \u028d\u01dd\u0279\u01dd \u0254\u0279\u01dd\u0250\u0287\u01ddd sn\u0254\u0254\u01ddss\u025fnll\u028e.", 
