    "All groups must have a name.": "\u023all \u0183\u0279\u00f8nds \u026fns\u0287 \u0265\u0250\u028c\u01dd \u0250 n\u0250\u026f\u01dd.", 
    "All groups must have a unique name.": "\u023all \u0183\u0279\u00f8nds \u026fns\u0287 \u0265\u0250\u028c\u01dd \u0250 nn\u1d09bn\u01dd n\u0250\u026f\u01dd.", 
    "All learners in the {cohort_name} cohort": "\u023all l\u01dd\u0250\u0279n\u01dd\u0279s \u1d09n \u0287\u0265\u01dd {cohort_name} \u0254\u00f8\u0265\u00f8\u0279\u0287", 
    "All learners who are enrolled in this course": "\u023all l\u01dd\u0250\u0279n\u01dd\u0279s \u028d\u0265\u00f8 \u0250\u0279\u01dd \u01ddn\u0279\u00f8ll\u01ddd \u1d09n \u0287\u0265\u1d09s \u0254\u00f8n\u0279s\u01dd", 
    "All payment options are currently unavailable.": "\u023all d\u0250\u028e\u026f\u01ddn\u0287 \u00f8d\u0287\u1d09\u00f8ns \u0250\u0279\u01dd \u0254n\u0279\u0279\u01ddn\u0287l\u028e nn\u0250\u028c\u0250\u1d09l\u0250bl\u01dd.", 
    "All professional education courses are fee-based, and require payment to complete the enrollment process.": "\u023all d\u0279\u00f8\u025f\u01ddss\u1d09\u00f8n\u0250l \u01dddn\u0254\u0250\u0287\u1d09\u00f8n \u0254\u00f8n\u0279s\u01dds \u0250\u0279\u01dd \u025f\u01dd\u01dd-b\u0250s\u01ddd, \u0250nd \u0279\u01ddbn\u1d09\u0279\u01dd d\u0250\u028e\u026f\u01ddn\u0287 \u0287\u00f8 \u0254\u00f8\u026fdl\u01dd\u0287\u01dd \u0287\u0265\u01dd \u01ddn\u0279\u00f8ll\u026f\u01ddn\u0287 d\u0279\u00f8\u0254\u01ddss.", 
    "All subsections": "\u023all snbs\u01dd\u0254\u0287\u1d09\u00f8ns", 
