    "Hide content after due date": "\u0126\u1d09d\u01dd \u0254\u00f8n\u0287\u01ddn\u0287 \u0250\u025f\u0287\u01dd\u0279 dn\u01dd d\u0250\u0287\u01dd", 
    "Hide entire subsection": "\u0126\u1d09d\u01dd \u01ddn\u0287\u1d09\u0279\u01dd snbs\u01dd\u0254\u0287\u1d09\u00f8n", 
    "Hide from learners": "\u0126\u1d09d\u01dd \u025f\u0279\u00f8\u026f l\u01dd\u0250\u0279n\u01dd\u0279s", 
    "Hide notes": "\u0126\u1d09d\u01dd n\u00f8\u0287\u01dds", 
    "Hiding from Students": "\u0126\u1d09d\u1d09n\u0183 \u025f\u0279\u00f8\u026f S\u0287nd\u01ddn\u0287s", 
    "High Definition": "\u0126\u1d09\u0183\u0265 \u0110\u01dd\u025f\u1d09n\u1d09\u0287\u1d09\u00f8n", 
