    "Paste is now in plain text mode. Contents will now be pasted as plain text until you toggle this option off.": "\u2c63\u0250s\u0287\u01dd \u1d09s n\u00f8\u028d \u1d09n dl\u0250\u1d09n \u0287\u01ddx\u0287 \u026f\u00f8d\u01dd. \u023b\u00f8n\u0287\u01ddn\u0287s \u028d\u1d09ll n\u00f8\u028d b\u01dd d\u0250s\u0287\u01ddd \u0250s dl\u0250\u1d09n \u0287\u01ddx\u0287 nn\u0287\u1d09l \u028e\u00f8n \u0287\u00f8\u0183\u0183l\u01dd \u0287\u0265\u1d09s \u00f8d\u0287\u1d09\u00f8n \u00f8\u025f\u025f.", 
