    "Photo ID": "\u2c63\u0265\u00f8\u0287\u00f8 \u0197\u0110", 
    "Photo Identification": "\u2c63\u0265\u00f8\u0287\u00f8 \u0197d\u01ddn\u0287\u1d09\u025f\u1d09\u0254\u0250\u0287\u1d09\u00f8n", 
