    "Practice Proctored": "\u2c63\u0279\u0250\u0254\u0287\u1d09\u0254\u01dd \u2c63\u0279\u00f8\u0254\u0287\u00f8\u0279\u01ddd", 
    "Practice proctored Exam": "\u2c63\u0279\u0250\u0254\u0287\u1d09\u0254\u01dd d\u0279\u00f8\u0254\u0287\u00f8\u0279\u01ddd \u0246x\u0250\u026f", 
    "Pre": "\u2c63\u0279\u01dd", 
    "Preferred Language": "\u2c63\u0279\u01dd\u025f\u01dd\u0279\u0279\u01ddd \u0141\u0250n\u0183n\u0250\u0183\u01dd", 
    "Preformatted": "\u2c63\u0279\u01dd\u025f\u00f8\u0279\u026f\u0250\u0287\u0287\u01ddd", 
    "Prerequisite:": "\u2c63\u0279\u01dd\u0279\u01ddbn\u1d09s\u1d09\u0287\u01dd:", 
