    "The following warnings were generated:": "\u0166\u0265\u01dd \u025f\u00f8ll\u00f8\u028d\u1d09n\u0183 \u028d\u0250\u0279n\u1d09n\u0183s \u028d\u01dd\u0279\u01dd \u0183\u01ddn\u01dd\u0279\u0250\u0287\u01ddd:", 
    "The general category for this type of assignment, for example, Homework or Midterm Exam. This name is visible to learners.": "\u0166\u0265\u01dd \u0183\u01ddn\u01dd\u0279\u0250l \u0254\u0250\u0287\u01dd\u0183\u00f8\u0279\u028e \u025f\u00f8\u0279 \u0287\u0265\u1d09s \u0287\u028ed\u01dd \u00f8\u025f \u0250ss\u1d09\u0183n\u026f\u01ddn\u0287, \u025f\u00f8\u0279 \u01ddx\u0250\u026fdl\u01dd, \u0126\u00f8\u026f\u01dd\u028d\u00f8\u0279\u029e \u00f8\u0279 M\u1d09d\u0287\u01dd\u0279\u026f \u0246x\u0250\u026f. \u0166\u0265\u1d09s n\u0250\u026f\u01dd \u1d09s \u028c\u1d09s\u1d09bl\u01dd \u0287\u00f8 l\u01dd\u0250\u0279n\u01dd\u0279s.", 
    "The grading process is still running. Refresh the page to see updates.": "\u0166\u0265\u01dd \u0183\u0279\u0250d\u1d09n\u0183 d\u0279\u00f8\u0254\u01ddss \u1d09s s\u0287\u1d09ll \u0279nnn\u1d09n\u0183. \u024c\u01dd\u025f\u0279\u01dds\u0265 \u0287\u0265\u01dd d\u0250\u0183\u01dd \u0287\u00f8 s\u01dd\u01dd ndd\u0250\u0287\u01dds.", 
    "The language that team members primarily use to communicate with each other.": "\u0166\u0265\u01dd l\u0250n\u0183n\u0250\u0183\u01dd \u0287\u0265\u0250\u0287 \u0287\u01dd\u0250\u026f \u026f\u01dd\u026fb\u01dd\u0279s d\u0279\u1d09\u026f\u0250\u0279\u1d09l\u028e ns\u01dd \u0287\u00f8 \u0254\u00f8\u026f\u026fnn\u1d09\u0254\u0250\u0287\u01dd \u028d\u1d09\u0287\u0265 \u01dd\u0250\u0254\u0265 \u00f8\u0287\u0265\u01dd\u0279.", 
    "The language used throughout this site. This site is currently available in a limited number of languages.": "\u0166\u0265\u01dd l\u0250n\u0183n\u0250\u0183\u01dd ns\u01ddd \u0287\u0265\u0279\u00f8n\u0183\u0265\u00f8n\u0287 \u0287\u0265\u1d09s s\u1d09\u0287\u01dd. \u0166\u0265\u1d09s s\u1d09\u0287\u01dd \u1d09s \u0254n\u0279\u0279\u01ddn\u0287l\u028e \u0250\u028c\u0250\u1d09l\u0250bl\u01dd \u1d09n \u0250 l\u1d09\u026f\u1d09\u0287\u01ddd nn\u026fb\u01dd\u0279 \u00f8\u025f l\u0250n\u0183n\u0250\u0183\u01dds.", 
