    "These settings include basic information about your account. You can also specify additional information and see your linked social accounts on this page.": "\u0166\u0265\u01dds\u01dd s\u01dd\u0287\u0287\u1d09n\u0183s \u1d09n\u0254lnd\u01dd b\u0250s\u1d09\u0254 \u1d09n\u025f\u00f8\u0279\u026f\u0250\u0287\u1d09\u00f8n \u0250b\u00f8n\u0287 \u028e\u00f8n\u0279 \u0250\u0254\u0254\u00f8nn\u0287. \u024e\u00f8n \u0254\u0250n \u0250ls\u00f8 sd\u01dd\u0254\u1d09\u025f\u028e \u0250dd\u1d09\u0287\u1d09\u00f8n\u0250l \u1d09n\u025f\u00f8\u0279\u026f\u0250\u0287\u1d09\u00f8n \u0250nd s\u01dd\u01dd \u028e\u00f8n\u0279 l\u1d09n\u029e\u01ddd s\u00f8\u0254\u1d09\u0250l \u0250\u0254\u0254\u00f8nn\u0287s \u00f8n \u0287\u0265\u1d09s d\u0250\u0183\u01dd.", 
