    "These users were successfully added as beta testers:": "\u0166\u0265\u01dds\u01dd ns\u01dd\u0279s \u028d\u01dd\u0279\u01dd sn\u0254\u0254\u01ddss\u025fnll\u028e \u0250dd\u01ddd \u0250s b\u01dd\u0287\u0250 \u0287\u01dds\u0287\u01dd\u0279s:", 
