    "This Group Configuration is not in use. Start by adding a content experiment to any Unit via the {linkStart}Course Outline{linkEnd}.": "\u0166\u0265\u1d09s \u01e4\u0279\u00f8nd \u023b\u00f8n\u025f\u1d09\u0183n\u0279\u0250\u0287\u1d09\u00f8n \u1d09s n\u00f8\u0287 \u1d09n ns\u01dd. S\u0287\u0250\u0279\u0287 b\u028e \u0250dd\u1d09n\u0183 \u0250 \u0254\u00f8n\u0287\u01ddn\u0287 \u01ddxd\u01dd\u0279\u1d09\u026f\u01ddn\u0287 \u0287\u00f8 \u0250n\u028e \u0244n\u1d09\u0287 \u028c\u1d09\u0250 \u0287\u0265\u01dd {linkStart}\u023b\u00f8n\u0279s\u01dd \u00d8n\u0287l\u1d09n\u01dd{linkEnd}.", 
    "This Group Configuration is used in:": "\u0166\u0265\u1d09s \u01e4\u0279\u00f8nd \u023b\u00f8n\u025f\u1d09\u0183n\u0279\u0250\u0287\u1d09\u00f8n \u1d09s ns\u01ddd \u1d09n:", 
