    "Use a practice proctored exam to introduce learners to the proctoring tools and processes. Results of a practice exam do not affect a learner's grade.": "\u0244s\u01dd \u0250 d\u0279\u0250\u0254\u0287\u1d09\u0254\u01dd d\u0279\u00f8\u0254\u0287\u00f8\u0279\u01ddd \u01ddx\u0250\u026f \u0287\u00f8 \u1d09n\u0287\u0279\u00f8dn\u0254\u01dd l\u01dd\u0250\u0279n\u01dd\u0279s \u0287\u00f8 \u0287\u0265\u01dd d\u0279\u00f8\u0254\u0287\u00f8\u0279\u1d09n\u0183 \u0287\u00f8\u00f8ls \u0250nd d\u0279\u00f8\u0254\u01ddss\u01dds. \u024c\u01ddsnl\u0287s \u00f8\u025f \u0250 d\u0279\u0250\u0254\u0287\u1d09\u0254\u01dd \u01ddx\u0250\u026f d\u00f8 n\u00f8\u0287 \u0250\u025f\u025f\u01dd\u0254\u0287 \u0250 l\u01dd\u0250\u0279n\u01dd\u0279's \u0183\u0279\u0250d\u01dd.", 
    "Use a timed exam to limit the time learners can spend on problems in this subsection. Learners must submit answers before the time expires. You can allow additional time for individual learners through the Instructor Dashboard.": "\u0244s\u01dd \u0250 \u0287\u1d09\u026f\u01ddd \u01ddx\u0250\u026f \u0287\u00f8 l\u1d09\u026f\u1d09\u0287 \u0287\u0265\u01dd \u0287\u1d09\u026f\u01dd l\u01dd\u0250\u0279n\u01dd\u0279s \u0254\u0250n sd\u01ddnd \u00f8n d\u0279\u00f8bl\u01dd\u026fs \u1d09n \u0287\u0265\u1d09s snbs\u01dd\u0254\u0287\u1d09\u00f8n. \u0141\u01dd\u0250\u0279n\u01dd\u0279s \u026fns\u0287 snb\u026f\u1d09\u0287 \u0250ns\u028d\u01dd\u0279s b\u01dd\u025f\u00f8\u0279\u01dd \u0287\u0265\u01dd \u0287\u1d09\u026f\u01dd \u01ddxd\u1d09\u0279\u01dds. \u024e\u00f8n \u0254\u0250n \u0250ll\u00f8\u028d \u0250dd\u1d09\u0287\u1d09\u00f8n\u0250l \u0287\u1d09\u026f\u01dd \u025f\u00f8\u0279 \u1d09nd\u1d09\u028c\u1d09dn\u0250l l\u01dd\u0250\u0279n\u01dd\u0279s \u0287\u0265\u0279\u00f8n\u0183\u0265 \u0287\u0265\u01dd \u0197ns\u0287\u0279n\u0254\u0287\u00f8\u0279 \u0110\u0250s\u0265b\u00f8\u0250\u0279d.", 
