    "Use bookmarks to help you easily return to courseware pages. To bookmark a page, select Bookmark in the upper right corner of that page. To see a list of all your bookmarks, select Bookmarks in the upper left corner of any courseware page.": "\u0244s\u01dd b\u00f8\u00f8\u029e\u026f\u0250\u0279\u029es \u0287\u00f8 \u0265\u01ddld \u028e\u00f8n \u01dd\u0250s\u1d09l\u028e \u0279\u01dd\u0287n\u0279n \u0287\u00f8 \u0254\u00f8n\u0279s\u01dd\u028d\u0250\u0279\u01dd d\u0250\u0183\u01dds. \u0166\u00f8 b\u00f8\u00f8\u029e\u026f\u0250\u0279\u029e \u0250 d\u0250\u0183\u01dd, s\u01ddl\u01dd\u0254\u0287 \u0243\u00f8\u00f8\u029e\u026f\u0250\u0279\u029e \u1d09n \u0287\u0265\u01dd ndd\u01dd\u0279 \u0279\u1d09\u0183\u0265\u0287 \u0254\u00f8\u0279n\u01dd\u0279 \u00f8\u025f \u0287\u0265\u0250\u0287 d\u0250\u0183\u01dd. \u0166\u00f8 s\u01dd\u01dd \u0250 l\u1d09s\u0287 \u00f8\u025f \u0250ll \u028e\u00f8n\u0279 b\u00f8\u00f8\u029e\u026f\u0250\u0279\u029es, s\u01ddl\u01dd\u0254\u0287 \u0243\u00f8\u00f8\u029e\u026f\u0250\u0279\u029es \u1d09n \u0287\u0265\u01dd ndd\u01dd\u0279 l\u01dd\u025f\u0287 \u0254\u00f8\u0279n\u01dd\u0279 \u00f8\u025f \u0250n\u028e \u0254\u00f8n\u0279s\u01dd\u028d\u0250\u0279\u01dd d\u0250\u0183\u01dd.", 
    "Use my institution/campus credentials": "\u0244s\u01dd \u026f\u028e \u1d09ns\u0287\u1d09\u0287n\u0287\u1d09\u00f8n/\u0254\u0250\u026fdns \u0254\u0279\u01ddd\u01ddn\u0287\u1d09\u0250ls", 
