    "Use your webcam to take a photo of your ID. We will match this photo with the photo of your face and the name on your account.": "\u0244s\u01dd \u028e\u00f8n\u0279 \u028d\u01ddb\u0254\u0250\u026f \u0287\u00f8 \u0287\u0250\u029e\u01dd \u0250 d\u0265\u00f8\u0287\u00f8 \u00f8\u025f \u028e\u00f8n\u0279 \u0197\u0110. W\u01dd \u028d\u1d09ll \u026f\u0250\u0287\u0254\u0265 \u0287\u0265\u1d09s d\u0265\u00f8\u0287\u00f8 \u028d\u1d09\u0287\u0265 \u0287\u0265\u01dd d\u0265\u00f8\u0287\u00f8 \u00f8\u025f \u028e\u00f8n\u0279 \u025f\u0250\u0254\u01dd \u0250nd \u0287\u0265\u01dd n\u0250\u026f\u01dd \u00f8n \u028e\u00f8n\u0279 \u0250\u0254\u0254\u00f8nn\u0287.", 
    "Use your webcam to take a photo of your face. We will match this photo with the photo on your ID.": "\u0244s\u01dd \u028e\u00f8n\u0279 \u028d\u01ddb\u0254\u0250\u026f \u0287\u00f8 \u0287\u0250\u029e\u01dd \u0250 d\u0265\u00f8\u0287\u00f8 \u00f8\u025f \u028e\u00f8n\u0279 \u025f\u0250\u0254\u01dd. W\u01dd \u028d\u1d09ll \u026f\u0250\u0287\u0254\u0265 \u0287\u0265\u1d09s d\u0265\u00f8\u0287\u00f8 \u028d\u1d09\u0287\u0265 \u0287\u0265\u01dd d\u0265\u00f8\u0287\u00f8 \u00f8n \u028e\u00f8n\u0279 \u0197\u0110.", 
